import React, { useState } from 'react';
import GenderDropdown from './dropdowns/Gender';
import LetterDropdown from './dropdowns/Letter';
import OriginDropdown from './dropdowns/Country';
import { GenderOption, Genders } from './dropdowns/menus/options'; // Importing gender options from the external file
import { letterOptions } from './dropdowns/menus/options'; // Importing letter options from the external file
import { country } from './dropdowns/menus/options'; // Importing country options from the external file

function App() {
  const [selectedGender, setSelectedGender] = useState(null);
  const [selectedLetter, setSelectedLetter] = useState(null);
  const [selectedOrigin, setSelectedOrigin] = useState(null);

  const handleSelectGender = (selectedOption) => {
    setSelectedGender(selectedOption);
  };

  const handleSelectLetter = (selectedOption) => {
    setSelectedLetter(selectedOption);
  };

  const handleSelectOrigin = (selectedOption) => {
    setSelectedOrigin(selectedOption);
  };

  const handleSubmit = () => {
    if (!selectedGender || !selectedLetter || !selectedOrigin) {
      alert('Please select gender, letter, and origin.');
      return;
    }
    // Perform other actions based on the selected options, such as updating state or showing data
    console.log('Selected gender:', selectedGender);
    console.log('Selected letter:', selectedLetter);
    console.log('Selected origin:', selectedOrigin);
  };

  return (
    <div className="App">
      <h1>Baby Name Generator</h1>
      <GenderDropdown options={genderOption} onSelectGender={handleSelectGender} />
      <LetterDropdown options={letterOption} onSelectLetter={handleSelectLetter} />
      <OriginDropdown options={country} onSelectOrigin={handleSelectOrigin} />
      <button onClick={handleSubmit}>Submit</button>
      {/* Other components or content */}
    </div>
  );
}

export default App;
